import './MainPage.css';
import { Link, Navigate } from 'react-router-dom'
import { useSelector } from 'react-redux'
import { AppState } from '../../state/reducers/root'
import { useEffect } from 'react';

import Navbar from './inner/Navbar/Navbar'
import OpenGame from './inner/OpenGame/OpenGame'
// import createNotification from '../../javascript-utils/growl-notifications'

const NotificationManager = require('react-notifications');



function createNotification(type: string, message: string, title = "", duration = 4000) {
  switch (type) {
    case 'info':
      return NotificationManager.info(message, title, duration);
      break;
    case 'success':
      return NotificationManager.success(message, title, duration);
      break;
    case 'warning':
      return NotificationManager.warning(message, title, duration);
      break;
    case 'error':
      return NotificationManager.error(message, title, duration);
      break;
  }
};

export default function MainPage(props: any) {

  const createNotification = (type: string, message: string, title = "", duration = 4000) => {
    return () => {
      switch (type) {
        case 'info':
          NotificationManager.info('Info message');
          break;
        case 'success':
          NotificationManager.success('Success message', 'Title here');
          break;
        case 'warning':
          NotificationManager.warning('Warning message', 'Close after 3000ms', 3000);
          break;
        case 'error':
          NotificationManager.error('Error message', 'Click me!', 5000, () => {
            alert('callback');
          });
          break;
      }
    };
  };

  const username: string | null = useSelector((state: AppState) => state).authentication.username

  /*
  function renderLoginIfNotLogged() {
    if (username == null)
      return <Navigate to="/login" replace />
  }

  Inside Return Div Container: {renderLoginIfNotLogged()}
  */

  function handle() {
    console.log("TESTING THIS SHIT")
    console.log(createNotification("info", "HI"))
  }

  return (
    <div>
      <Navbar />
      <div className="container main-page-contents" onClick={handle}>
        <div className="row justify-content-md-center">
          <div className="col open-game-outer-container">
            <OpenGame />
          </div>
        </div>
      </div>
    </div>
  );
}
